(64, 1, '2020-10-29 16:17:25', '2020-10-29 03:17:25', '<!-- wp:paragraph -->\n<p>A group of friends – all with a passion for helping animals – got together and formed the non-profit organisation ‘Friends of Animal Charities’ – to assist animal welfare organisations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The group fundraised for many weeks, in the form of garage sales, raffles, coffee mornings and markets – raising awareness and support for animals. In April 2014 the group opened a charity shop.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The shop is run by volunteers, and all money raised goes to assist organisations whose objectives are to assist animal welfare or who promote the care and well being of animals.</p>\n<!-- /wp:paragraph -->', 'The story behind Friends of Animal Charities', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2020-10-29 16:17:25', '2020-10-29 03:17:25', '', 14, 'http://localhost/friendsofanimals/14-revision-v1/', 0, 'revision', '', 0),
(65, 1, '2020-10-29 16:24:42', '2020-10-29 03:24:42', '<!--(figmeta)eyJmaWxlS2V5IjoiSGRVNlBncWJPZXdnMlhxck1BWENSUCIsInBhc3RlSUQiOi0xLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)--><!--(figma)(/figma)-->A group of friends – all with a passion for helping animals – got together and formed the non-profit organisation ‘Friends of Animal Charities’ – to assist animal welfare organisations.\r\n\r\nThe group fundraised for many weeks, in the form of garage sales, raffles, coffee mornings and markets – raising awareness and support for animals. In April 2014 the group opened a charity shop.\r\n\r\nThe shop is run by volunteers, and all money raised goes to assist organisations whose objectives are to assist animal welfare or who promote the care and well being of animals.', 'The story behind Friends of Animal Charities', '', 'publish', 'closed', 'closed', '', 'the-story-behind-friends-of-animal-charities', '', '', '2020-10-29 16:24:42', '2020-10-29 03:24:42', '', 0, 'http://localhost/friendsofanimals/?post_type=section&#038;p=65', 0, 'section', '', 0),
